import React from 'react';
import './CSS/footer.css'
import insta from '../img/logo_intsa.png';
import fb from '../img/logo_fb.png';
import twitter from '../img/logo_twitter.png';
import linkdin from '../img/logo_in.png';

export default class Footer extends React.Component{
    render(){
        return(
            <div className="footer">
                <p className="copyright">
                    Portfolio 2020 &copy; Copyrights reserved.
                </p>
                <a href="https://www.instagram.com/aannaassalam/">i.fa fa-twitter-square fa-3</a>
                <a href="https://www.facebook.com/anasalam027/"><img src={fb} alt="Facebook"/></a>
                <a href="https://twitter.com/aannaassalam/"><img src={twitter} alt="Twitter"/></a>
                <a href="https://www.linkedin.com/in/anas-alam-0207331b2/"><img src={linkdin} alt="LinkDin"/></a>
            </div>
        )
    }
}
